"121567":{"id":"121567","name":"Koala Man","slug":"koala-man","original_title":"Koala Man","overview":"Kevin é um pai de meia-idade, e Koala Man é sua identidade não tão secreta, cujo único superpoder é uma paixão ardente por seguir regras e impedir crimes pequenos. Koala Man está em uma missão para limpar a cidade de Dapto, muitas vezes envolvendo sua família em suas aventuras cada vez mais bizarras.","first_air_date":"2023-01-09","episode_run_time":0,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Michael Cusack"],"production_companies":["20th Television Animation","Bento Box Entertainment","Princess Bento Studio","Princess Pictures","Cusack Creatures","Hermit House","Justin Roiland's Solo Vanity Card Productions"],"genres":["Animação","Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/64j3QBLDvPE5VXU8yUboVmuy9Sn.jpg","poster_path":"https://image.tmdb.org/t/p/original/4Cuorul21MQ7zRsOHF52OXiNo8o.jpg","cast":["Michael Cusack","Sarah Snook","Demi Lardner"],"trailer":"l_UBOR1fy0g","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4Cuorul21MQ7zRsOHF52OXiNo8o.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4Cuorul21MQ7zRsOHF52OXiNo8o.jpg","air_date":"2023-01-09","episode_count":8,"overview":"N/A","vote_average":5.3,"episodes":{"1":{"name":"Dia do Lixo","overview":"Big Greg inspira Kevin a escrever uma música tema para Koala Man. Mas quando Kevin se esquece de levar as latas de lixo para a rua, uma fera monstruosa com fome de lixo surge.","air_date":"2023-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/yMG9hHbrG5v8oSXTc8mazuLj8PF.jpg","vote_average":8.3},"2":{"name":"Fundo do Bolso","overview":"Koala Man tenta obter uma licença oficial de super-herói de Big Greg para poder competir com os Tradies. Na escola, Vicky lança uma iniciativa saudável proibindo refrigerantes, o que leva Alison a contrabandeá-los para outros alunos.","air_date":"2023-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/9XcOqunO8zJZZUjAxtU2Ihks9nu.jpg","vote_average":6},"3":{"name":"A Regra Disciplinar","overview":"A Rainha está vindo para Dapto! Koala Man fica animadíssimo e se oferece para cuidar da segurança. Infelizmente, Liam está mais interessado em seu novo amigo americano, Chad Wagon, do que na Rainha. Kevin despreza Chad Wagon: o que aconteceu com os bons e velhos valores australianos?","air_date":"2023-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cd7R7LJndcdwCJIkFlvJ6jiACsT.jpg","vote_average":2},"4":{"name":"O Grande","overview":"A família Williams visita o Dapto Royal Show, onde um meteoro colide com Dapto. Seus residentes começam a se comportar de maneira bizarra, liderados por uma Janine estranhamente calma. Vicky está se sentindo insatisfeita com Kevin e se volta para a nova comunidade de amor próprio de Janine.","air_date":"2023-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/bjhs1hb806TYX4o9QBbx276g7cP.jpg","vote_average":3},"5":{"name":"Homenagem a um Koala","overview":"Liam e Alison partem para um acampamento musical de fim de semana no Outback, mas Liam esquece sua jaqueta. Kevin insiste em trazê-la para ele, mas para isso ele deve enfrentar cangurus, o mal e seu próprio passado para chegar lá. Prepare-se para muitos flashbacks!","air_date":"2023-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aXUmcarc1ED5YdV94mXW0ExI0DG.jpg","vote_average":5},"6":{"name":"Handebol","overview":"Dapto está sediando as Olimpíadas de Handebol! Uma tragédia atinge a equipe e Koala Man chega para formar um novo time. Ele recruta Alison e Liam, treinando-os para jogar limpo, mas Big Greg tem outros planos para vencer o time de Sydney treinado por seu irmão insensível, Huge Greg.","air_date":"2023-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dayNmYA52aZi2821roUUI5YZyik.jpg","vote_average":5},"7":{"name":"Guerra com os Emus","overview":"Quando alguém faz uma omelete com o ovo de um emu real, os emus se vingam atacando Dapto. Koala Man vai fazer tudo o que puder para proteger sua família desta guerra aviária. Quando a família e outros sobreviventes se escondem dos emus, Alison finalmente faz amizade com Rosie Yodels.","air_date":"2023-01-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/uZtOG3OMXfNpU56dRk9GPdjYHFs.jpg","vote_average":6},"8":{"name":"Natal Quente","overview":"Koala Man está à beira da morte, preso na Ilha Escova de Dente e desesperado para finalmente enfrentar o Kookaburra. Em casa, Vicky sente falta de Kevin: o Natal não será o mesmo sem ele. Liam está em coma no hospital, exausto de tanto lutar contra os emus. Alison e Rosie ficam mais próximas.","air_date":"2023-01-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/q88Y6O77i4hiXfm9Be4At72ur4P.jpg","vote_average":7}}}}},
