"282209":{"id":"282209","name":"Cãezinhos no Passeio","slug":"caezinhos-no-passeio","original_title":"홈앤버튼","overview":"Quando os humanos estão longe, um cãozinho fofo e muito curioso adora se juntar com os outros cachorrinhos e brincar com seus melhores amigos: seus brinquedos favoritos!","first_air_date":"2025-02-13","episode_run_time":0,"vote_average":6,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Ahn Byoung-wook"],"production_companies":["CJ ENM","Million Volt"],"genres":["Kids","Animação"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/6N22kidmy5UV1qCm5FUuwMOlQ2i.jpg","poster_path":"https://image.tmdb.org/t/p/original/hwlWcwKHdOOmu9DUNfZtanLAGoJ.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/iJrftyVahNLF2LKahhmlSNfX1Cy.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/iJrftyVahNLF2LKahhmlSNfX1Cy.jpg","air_date":"2025-02-13","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Cachorro-aranha / Golfe e confusão / Voar de novo","overview":"Holm e Button fingem ser super-heróis que enfrentam esquilos. Um jogo de golfe sai do controle quando a bola desaparece. Um pombo come muita ração.","air_date":"2025-02-13","runtime":16,"still_path":"https://image.tmdb.org/t/p/original/wUVc6nZhB5QvsoZxddbJCpTgT0h.jpg","vote_average":0},"2":{"name":"Corrida de kart de cachorro / Babás / Perseguindo o peru","overview":"Os cachorros e os brinquedos correm pela vizinhança. Os esquilos tentam roubar o lanche de Holm. A bola de Momo vai parar dentro de um peru.","air_date":"2025-02-13","runtime":17,"still_path":"https://image.tmdb.org/t/p/original/fwxpdZcRBpHXyZQeiSGcuAUJEW8.jpg","vote_average":0},"3":{"name":"Árvore de linguiça / Pista de patinação de bananas / Campeonato de dança","overview":"Holm tenta plantar linguiças. Cascas de banana escorregadias transformam a rua em uma pista de patinação. Os cachorros fazem uma competição de dança.","air_date":"2025-02-13","runtime":16,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Presente de aniversário / Caça ao tesouro dourado / Dia de futebol","overview":"Um pombo rouba um presente especial. Holm e Button seguem um mapa do tesouro e encontram uma surpresa. Os cãezinhos se enfrentam em um jogo de futebol.","air_date":"2025-02-13","runtime":17,"still_path":"https://image.tmdb.org/t/p/original/hHpbiMCTES6GnhsIjb2iYkBKqiS.jpg","vote_average":0},"5":{"name":"Competição maluca / Lista de desejos desaparecida / Montanha-russa e tempestade","overview":"Os cachorrinhos e seus amigos jogam frisbee. Alguém rouba o osso com a lista de desejos de Holm. Uma tempestade atrapalha o acampamento de Holm e Button.","air_date":"2025-02-13","runtime":16,"still_path":"https://image.tmdb.org/t/p/original/nW47Dp1Q21jNGa4UXjJ7t7klHdN.jpg","vote_average":0},"6":{"name":"Noite em claro / Cidade das bolhas / Caça ao fantasma","overview":"Holm e Button acordam com um ronco bem chato. Uma bolha de pum deixa toda a vizinhança fedendo. Holm e Button organizam uma festa de Halloween.","air_date":"2025-02-13","runtime":16,"still_path":"https://image.tmdb.org/t/p/original/lCkv6clUWw0YL5lmxDMLddOq520.jpg","vote_average":0},"7":{"name":"Grude / Fugindo do calor / Hora do banho","overview":"Um balão de chiclete estoura. Os cachorrinhos brigam por um bloco de gelo durante uma onda de calor. Victoria e D5 tentam dar banho em Holm e Button.","air_date":"2025-02-13","runtime":16,"still_path":"https://image.tmdb.org/t/p/original/1fQ5eVtl6WGj5tN5ou4u8czeMEX.jpg","vote_average":0},"8":{"name":"Confusão do hambúrguer / Encontro desastroso / Casa na árvore","overview":"Momo tenta pegar um hambúrguer picante. Holm sai com Wari, mas não consegue parar de peidar! A casa na árvore de Holm e Button sai rolando.","air_date":"2025-02-13","runtime":17,"still_path":"https://image.tmdb.org/t/p/original/zgamWzre4LJ6fiYwkd5upao5Aaj.jpg","vote_average":0}}}}},
