"139171":{"id":"139171","name":"Let Me Check the Walkthrough First","slug":"let-me-check-the-walkthrough-first","original_title":"暂停！让我查攻略","overview":"Lin Yinuo é uma funcionária de escritório de 30 anos com uma paixão por videogames. Um dia, por acidente, ela é transportada para um mundo virtual de um jogo. Para encontrar o caminho de volta à sua própria realidade, ela se vê obrigada a treinar Tian Enya, o jovem herói do mundo do jogo. Juntos, eles embarcam em uma jornada de aprendizado e crescimento enquanto exploram os diversos níveis deste jogo. Com a amizade de novos aliados, nada pode detê-los!","first_air_date":"2022-05-21","episode_run_time":25,"vote_average":5.8,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["bilibili","KUNGFUFROG ANIMATION","Pb Animation"],"genres":["Animação","Comédia","Action & Adventure"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/vasZVqoCCz8nbVOOwJ3NjSXucpT.jpg","poster_path":"https://image.tmdb.org/t/p/original/wjqu0Sgs0a9zJhrrO70sDGucOLD.jpg","cast":["Xiaomeng Li","Ye Zhiqiu","Shan Xin","Lan Jiu","Meme Yan"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/xcTR19KkuRxUWWgSEUhl3FRlmNM.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/xcTR19KkuRxUWWgSEUhl3FRlmNM.jpg","air_date":"2022-05-21","episode_count":12,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"Eu posso salvar o mundo com 30 anos?","overview":"Liu Yinuo é uma mulher de 30 anos que trabalha em uma empresa que sempre a desgasta. Além de trabalhar sobre pressão sem parar, ela ainda tem que fazer horas extras todos os dias. Seu único alívio é jogar videogame quando chega em casa. Um dia, ela faz um desejo e acorda em outro mundo.","air_date":"2022-05-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5qi5Qlx9Ayt9HD50EBTtW7uJity.jpg","vote_average":6.5},"2":{"name":"Se ninguém descobrir, eu tô dentro","overview":"Yinuo começa a conhecer mais sobre Enya, até que descobre que ela tem algo em comum com sua vida passada. As duas resolvem ir para a cidade, mas acabam encontrando alguns problemas no caminho...","air_date":"2022-05-21","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/914sZHgX6npmYyf8aCFV1z42XwJ.jpg","vote_average":6.5},"3":{"name":"Fuga da Prisão! Fuja das Celas Subterrâneas","overview":"Yinuo e Enya estão presas numa prisão subterrânea. Agora elas tentam o possível para escapar. Enquanto isso, uma dupla de garotas misteriosas aparece...","air_date":"2022-05-28","runtime":18,"still_path":"https://image.tmdb.org/t/p/original/q00ZZG9gDq1QIMYUgk9lWNuZv7J.jpg","vote_average":6},"4":{"name":"Modo Automático! Deixa Eu Ganhar Pontos de Experiência","overview":"Depois de escapar da prisão, Yinuo e Enya precisam descobrir a verdade sobre o que está acontecendo no mundo. Elas vão até Cherry, a ferreira. No entanto, para continuar sua aventura, elas precisarão ganhar muitos níveis...","air_date":"2022-06-04","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/ifHLm9Pb91vlbWATO76LJNnTplO.jpg","vote_average":6},"5":{"name":"Eu acho que sirvo mais para trabalhar na fazenda","overview":"Yinuo e Enya encontraram Budo, maga amiga de Cherry. No entanto, agora elas precisam convencê-la a deixar sua vida calma da fazenda para partir em busca de novas aventuras.","air_date":"2022-06-11","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/6NljqVDvoUlJWzpuNAYem9uzE7J.jpg","vote_average":5},"6":{"name":"Jogue Gacha com Responsabilidade","overview":"Yinuo e Enya entram na Caverna dos Desafios para conseguir uma invocação para Enya. No entanto, descobrem que estão sujeitas a um sistema de gacha...","air_date":"2022-06-18","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/yNkOxrQjCj6YeF8euhYIMXCERhs.jpg","vote_average":0},"7":{"name":"Gosta de Música?","overview":"Enquanto Liu Yinuo e Enya continuam na Caverna dos Desafios, Jinjin chega até a fazenda com parte dos pertences delas. Mas será que elas conseguirão sair com vida da caverna?","air_date":"2022-06-25","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/GjtlB6vG1fuMUeLCaTwVJg9pOt.jpg","vote_average":0},"8":{"name":"Ah! Tenho que Fazer as Missões Básicas","overview":"Nossas heroínas descobrem um torneio de artes marciais em uma cidade próxima, o que pode concretizar uma visão de Enya. Sem muita escolha, ela decide partir para treinar. Enquanto isso, Wilf começa a suspeitar de Lailai e Balor.","air_date":"2022-07-02","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/xyiB1RQi9DQWt85OuRnEnmHopGQ.jpg","vote_average":0},"9":{"name":"Começa o Torneio de Artes Marciais! Prepare-se Para Terminar o Estágio","overview":"Yinuo traça uma estratégia para lutar contra o Rei Demônio e, finalmente, começa o Torneio de Artes Marciais. Mas em meio a todos os participantes, duas guerreiras misteriosas roubam a cena. Será que Yinuo e Enya conseguirão vencer?","air_date":"2022-07-09","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/dLWHmWeD5x5bVtTavhf9IhK2nm1.jpg","vote_average":0},"10":{"name":"Assim que a Salvadora Luta","overview":"O torneio continua. Agora é a vez de Enya lutar contra Nagu. Mas será que ela conseguirá vencer, sem ter grandes poderes?","air_date":"2022-07-16","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/8fyjdMouOgns3mnat2YbAuP7EFM.jpg","vote_average":0},"11":{"name":"Missão de Emergência: Salvar a Enya!","overview":"A verdadeira identidade de Balor é revelada. Será que Yinuo e Enya serão capazes de detê-la?","air_date":"2022-07-23","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/vvLhQW3GUMicK44kKUtD2ovPf6C.jpg","vote_average":0},"12":{"name":"Salvar Noa","overview":"Toda a verdade foi revelada, mas Yinuo começou a desaparecer. Enquanto todos esperam que Tian Enya salve o mundo, ela só pensa em salvar sua professora. Será que há salvação para Yinuo e para o continente de Noa?","air_date":"2022-07-30","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/rwuoCOhSGhMl0gbpAfJZfvVHlAU.jpg","vote_average":0}}}}},
